import styled from 'styled-components';

export const ContactWrap = styled.div`
    padding: 3rem 0;
    display: flex;
    flex-direction: column;
    flex-warp: wrap;
`
export const GetInTouchWrap = styled.div`
    display: flex;
    flex-direction: column;
`
export const GetInTouchHeading = styled.h2`
    font-family: 'Gentona Bold';
    color: #4a5668;
    font-size: 46px;
    font-weight: 800;
    margin-bottom: 16px;
`
export const GetInTouchText = styled.p`
    width: 40%;
    font-size: 18px;
    color: #4a5568;
    line-height: 23px;
`
export const QuickLinkWrap = styled.div`
    display: flex;
    flex-direction: column;
    padding: 4rem 0;
`
export const QuickLinkIconWrap = styled.div`
    display: flex;
    margin-bottom: 2em;
`
export const QuickLinkIcon = styled.img`
    width: 100%;
    max-width: 30px;
    margin-right: 20px;
`
export const QuickLinkIcon2 = styled.img`
    width: 100%;
    max-width: 36px;
    margin-right: 14px;
`
export const QuickLinkText1 = styled.span`
    font-size: 18px;

`
export const QuickLinkText2 = styled.span`
    font-size: 18px;

    &:last-child {
        margin-top: 7px;
    }
`
